import httpService from '../../service/httpService'

export default {
    // 密码登录
    async pwdLogin(obj) {
        return httpService({
            url: `/app/login`,
            method: 'post',
            body: obj,
            loading: false
        })
        // return httpService.post(`/app/login`, obj)
    },
    // 短信登录
    async codeLogin(obj) {
        return httpService({
            url: `/app/phone_login`,
            method: 'post',
            body: obj,
            loading: false
        })
        // return httpService.post(`/app/phone_login
        // `, obj)
    },
    // 找回密码
    async retrievePwd(obj) {
        // return httpService.post(`/app/retrieve-password
        // `, obj)
        return httpService({
            url: `/app/retrieve-password`,
            method: 'post',
            body: obj,
            loading: false
        })
    },
    // 注册
    async register(obj) {
        // return httpService.post(`/front/register
        // `, obj)
        return httpService({
            url: `/front/register`,
            method: 'post',
            body: obj,
            loading: false
        })
    }
}
